export function fetchTests() {
  return fetch("http://localhost:8000/tests", {
    method: 'GET',
  })
  .then((res) => res.json())
  .catch((err) => {
      console.log('error fetching tests:' + err);
      return 'error fetching tests:' + err;
  }).PromiseResults;
}
